import React from 'react';
import menuList from '../utils/menuList';
import '../stylesheets/header.css';

function Navbar() {
  const menu = menuList.map((item) => (
    <li key={item.index} className="menu-list">
      <div>
        <img src={item.imageUrl} alt={item.imageAlt} className="menu-icon" />
      </div>
      <div>
        { item.title }
      </div>
    </li>
  ));

  return (
    <div className="navbar">
      <h2>Menu</h2>
      <ul className="menu">
        {menu}
      </ul>
    </div>
  );
}

export default Navbar;
